parameters.jsCode:
let markdown = $json.markdown;
const images = $json.images || [];

for (const image of images) {
  const fileName = image.id; // e.g. "img-35.jpeg"
  const annotation = image.image_annotation || '';

  const imageMarkdown = `![${fileName}](${fileName})`;
  const annotatedMarkdown = `${imageMarkdown}\n\n${annotation}`;

  markdown = markdown.replaceAll(imageMarkdown, annotatedMarkdown);
}

return {
  json: {
    ...$json,
    markdown
  }
};

